CREATE 
	DEFINER = 'root'@'localhost'
VIEW vw_distinct_individuals
AS
SELECT
  `vw_imp_tables`.`id` AS `ID`,
  `vw_imp_tables`.`CSV_FIELD15` AS `_age`,
  `vw_imp_tables`.`CSV_FIELD19` AS `farmer_name`,
  `vw_imp_tables`.`CSV_FIELD20` AS `farmer_surname`,
  ROW_NUMBER() OVER (PARTITION BY `vw_imp_tables`.`CSV_FIELD15`, `vw_imp_tables`.`CSV_FIELD19`, `vw_imp_tables`.`CSV_FIELD20`
  ORDER BY `vw_imp_tables`.`id`) AS `INDIVIDUALCOUNTER`
FROM `vw_imp_tables`;

--
-- Create view `vw_individuals`
--
CREATE 
	DEFINER = 'root'@'localhost'
VIEW vw_individuals
AS
SELECT
  `vit`.`id` AS `ID`,
  `vit`.`CSV_FIELD5` AS `username`,
  `vit`.`CSV_FIELD7` AS `phonenumber`,
  `vit`.`CSV_FIELD15` AS `_age`,
  `vit`.`CSV_FIELD19` AS `farmer_name`,
  `vit`.`CSV_FIELD20` AS `farmer_surname`,
  `vit`.`CSV_FIELD23` AS `Input_Surveyor_ID`,
  `vit`.`CSV_FIELD25` AS `_roles_multiple`,
  `vit`.`CSV_FIELD26` AS `gender`,
  `vit`.`CSV_FIELD27` AS `signature_farmmer`,
  `vit`.`CSV_FIELD28` AS `signature_surveyor`,
  `vit`.`CSV_FIELD29` AS `image_farmer`,
  `vit`.`CSV_FIELD30` AS `image_farmer_headshot`
FROM (`vw_imp_tables` `vit`
  JOIN `vw_distinct_individuals` `vdi`)
WHERE ((`vit`.`id` = `vdi`.`ID`)
AND (`vit`.`id` > 1)
AND (`vdi`.`INDIVIDUALCOUNTER` = 1)
AND (`vit`.`CSV_FIELD19` > '')
AND (`vit`.`CSV_FIELD20` > ''))
ORDER BY `vit`.`id`;

